import React, { useCallback } from "react";
import { Avatar, Card, Button } from "antd";
import styled from "styled-components";

const LogOutButtonWrapper = styled(Button)`
    margin-left: 50px;
`;
const UserProfile = ({ setIsLoggedIn }) => {
    const onLogOut = useCallback(() => {
        setIsLoggedIn(false);
    }, []);

    return (
        <Card
            actions={[
                <div key="twit">
                    짹짹 <br />0
                </div>,
                <div key="followings">
                    팔로잉 <br />0
                </div>,
                <div key="followings">
                    팔로워 <br />0
                </div>,
            ]}
        >
            <Card.Meta avatar={<Avatar>HC</Avatar>} title="HyeonCheol" />
            <LogOutButtonWrapper onClick={onLogOut}>
                로그아웃
            </LogOutButtonWrapper>
        </Card>
    );
};

export default UserProfile;
